  // Provide basic `.col-{bp}` classes for equal-width flexbox columns\n      .col#{$infix} {\n        flex-basis: 0;\n        flex-grow: 1;\n        max-width: 100%;\n      }\n      .col#{$infix}-auto {\n        flex: 0 0 auto;\n        width: auto;\n        max-width: 100%; // Reset earlier grid tiers\n      }\n\n      @for $i from 1 through $columns {\n        .col#{$infix}-#{$i} {\n          @include make-col($i, $columns);\n        }\n      }\n\n      .order#{$infix}-first { order: -1; }\n\n      .order#{$infix}-last { order: $columns + 1; }\n\n      @for $i from 0 through $columns {\n        .order#{$infix}-#{$i} { order: $i; }\n      }\n\n      // `$columns - 1` because offsetting by the width of an entire row isn't possible\n      @for $i from 0 through ($columns - 1) {\n        @if not ($infix == \"\" and $i == 0) { // Avoid emitting useless .offset-0\n          .offset#{$infix}-#{$i} {\n            @include make-col-offset($i, $columns);\n          }\n        }\n      }\n    }\n  }\n}\n","/**\r\n * @license\r\n * Copyright Akveo. All Rights Reserved.\r\n * Licensed under the MIT License. See License.txt in the project root for license information.\r\n */\r\n\r\n @mixin ngx-pace-theme() {\r\n\r\n  .pace .pace-progress {\r\n    background: nb-theme(color-primary-default);\r\n  }\r\n\r\n  .pace .pace-progress-inner {\r\n    box-shadow: 0 0 10px nb-theme(color-primary-default), 0 0 5px nb-theme(color-primary-default);\r\n  }\r\n\r\n  .pace .pace-activity {\r\n    display: none;\r\n  }\r\n}\r\n","@import './themes';\r\n\r\n@mixin nb-overrides() {\r\n  nb-select.size-medium button {\r\n    padding: 0.4375rem 2.2rem 0.4375rem 1.125rem !important;\r\n\r\n    nb-icon {\r\n      right: 0.41rem !important;\r\n    }\r\n  }\r\n}\r\n\r\n.nb-theme-dark nb-layout-header, nb-layout .layout, nb-sidebar, .content nb-layout-footer nav{\r\n  background-color: #121212 !important;\r\n}\r\n\r\n.nb-theme-dark nb-layout-header nav{\r\nbox-shadow: 0 0.5rem 1rem 0 #161616 !important;